import axios from 'axios'

const LOGIN_API_BASE_URL = 'https://localhost:8080/api/v1/login'

class TokenService{
    getTokens(){
        return axios.post(LOGIN_API_BASE_URL,{
            params: {
                username: 'nicolasbrambilla', 
                password: 'probandoclave'
            }
        }).then(response => {
                console.log(response);

        });
    }
}

export default new TokenService()
